import React, { Component } from 'react'
import { Menu } from 'semantic-ui-react'
import { Link } from "react-router-dom";

const SideMenu = () => {

    const getMenu = () => {

        return (
            <Menu fixed='left' borderless  vertical>
                <Menu.Item as={Link} to={'/'} name='dashboard'
                    >
                    <Label  color='teal' name='home'>
                        Dashboard
                    </Label>
                </Menu.Item>

                <Menu.Item as={Link} to={'/appointments'} name='appointments'
                   
                    >
                    <Label name='calendar'>
                        Appointments
                    </Label>
                </Menu.Item>

                <Menu.Item
                    as={Link} to={'/userManagement'}
                    name='userManagement'
                   
                    // onClick={this.handleItemClick}
                >
                    <Label name='users'>
                        Patients
                    </Label>
                </Menu.Item>

                <Menu.Item as={Link} to={'/card'} name='card'
                   >

                    <Label hideText={this.props.smallMenu} name='time'>
                        Card
                    </Label>
                </Menu.Item>

            </Menu>
        )
    }

    return (
        <div className='parent'>
            <div>
                {getMenu}
            </div>
        </div>
    )
}


export default SideMenu;
